export default Head = styled.div`

 display: flex;
 align-items: center;
 justify-content: space-around;
 background-color: #127E71;
 
 h1{
     color:#fff;
     font-size:20;
     font-family:'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
 }
 img{
     max-width:200px;
     height: 50px;
 }
`
